measurements.description:
Sixty-one flowers and 29 buds on 17 inflorescences up to 19cm; 
	vigorous 90-cm wide by 55-cm tall plant in bark, 
	30-cm plastic pot; sepals and petals magenta; petals undulate swept forward; lip tubular,
	interior white, heavily veined dark magenta, central stripe bright yellow, margins ruffled;
	substance medium; texture matte; plant dropped in transit, minor foliage and flower damage, pot cracked.
